import axios from "axios";
import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import { apiUrl } from "../axios";

export default function Register() {
  const [formValues, setFormValues] = useState({});
  const [formError, setFormError] = useState({});
  const navigate = useNavigate();

  const onChangeHandler = (e) => {
    const { name, value } = e.target;

    if (name === "cpassword") {
      if (value !== formValues?.password) {
        setFormError({ ...formError, ["password"]: "*Passwords do not match" });
      } else {
        setFormError({ ...formError, ["password"]: "" });
      }
    } else {
      setFormValues({ ...formValues, [name]: value });
      if (name === "password" && formValues.cpassword) {
        // Validate password match when typing in password
        if (formValues.cpassword !== value) {
          setFormError({ ...formError, ["password"]: "*Passwords do not match" });
        } else {
          setFormError({ ...formError, ["password"]: "" });
        }
      }
    }
  };

  const submit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post(apiUrl + "/user/", formValues);
      if (response.status === 200) {
        alert("Registration successful!");
        navigate("/login");
      }
    } catch (error) {
      console.error("Registration error:", error);
      alert("Registration failed. Please try again.");
    }
  };

  return (
    <div className="container mt-5" style={{ maxWidth: "35%", boxShadow: "2px 3px 8px black", backgroundColor: "lightblue" }}>
      <h3 className="text-dark text-center m-4">Registration</h3>
      <form onSubmit={submit} method="post">
        {/** First Name */}
        <div className="row mb-2">
          <div className="col">
            <label htmlFor="first_name">First Name</label>
          </div>
          <div className="col">
            <input
              required
              type="text"
              name="first_name"
              id="first_name"
              placeholder="First Name"
              className="form-control"
              onChange={onChangeHandler}
            />
          </div>
        </div>

        {/** Last Name */}
        <div className="row mb-2">
          <div className="col">
            <label htmlFor="last_name">Last Name</label>
          </div>
          <div className="col">
            <input
              type="text"
              name="last_name"
              id="last_name"
              placeholder="Last Name"
              className="form-control"
              onChange={onChangeHandler}
            />
          </div>
        </div>

        {/** Username */}
        <div className="row mb-2">
          <div className="col">
            <label htmlFor="username">Username</label>
          </div>
          <div className="col">
            <input
              required
              type="text"
              name="username"
              id="username"
              placeholder="Username"
              className="form-control"
              onChange={onChangeHandler}
            />
          </div>
        </div>

        {/** Mobile Number */}
        <div className="row mb-2">
          <div className="col">
            <label htmlFor="mobile">Mobile Number</label>
          </div>
          <div className="col">
            <input
              required
              type="text"
              name="mobile_no"
              id="mobile"
              placeholder="Mobile Number"
              pattern="[6789][0-9]{9}" title="Please enter a valid phone number"
              className="form-control"
              onChange={onChangeHandler}
            />
          </div>
        </div>

        {/** Email */}
        <div className="row mb-2">
          <div className="col">
            <label htmlFor="email">Email</label>
          </div>
          <div className="col">
            <input
              required
              type="email"
              name="email"
              id="email"
              placeholder="Email"
              className="form-control"
              onChange={onChangeHandler}
            />
          </div>
        </div>

        {/** Password */}
        <div className="row mb-2">
          <div className="col">
            <label htmlFor="password">Password</label>
          </div>
          <div className="col">
            <input
              required
              type="password"
              className="form-control"
              name="password"
              id="password"
              placeholder="Password"
              pattern="(?=.*\d)(?=.*[a-z])(?=.*[A-Z]).{8,}" 
              title="Must contain at least one number and one uppercase and lowercase letter, and at least 8 or more characters"
              onChange={onChangeHandler}
            />
          </div>
        </div>

        {/** Confirm Password */}
        <div className="row mb-2">
          <div className="col">
            <label htmlFor="cpassword">Confirm Password</label>
          </div>
          <div className="col">
            <input
              required
              type="password"
              name="cpassword"
              placeholder="Confirm Password"
              className="form-control"
              id="cpassword"
              onChange={onChangeHandler}
            />
            <p className="text-danger">{formError?.password}</p>
          </div>
        </div>

        {/** Submit Button */}
        <div className="row mt-2">
          <div className="col"></div>
          <div className="col-8">
            <button type="submit" className="btn btn-dark">Register</button>
          </div>
        </div>
      </form>
    </div>
  );
}
